object.script:
MovingAverage = { new = function(cls) return { ringBuffer={}, -- The ring buffer we use for calculation insertPoint=0, -- Where to insert next item in ring buffer bufferLength=0, -- number of valid values in the ring buffer runningTotal=0, -- Running total of ring buffer: update after each value update=cls.update } end, update = function(self, newValue, maxBufferSize) -- adjust size of buffer if required if maxBufferSize <= self.bufferLength then for i = maxBufferSize, self.bufferLength - 1 do self.runningTotal = self.runningTotal - self.ringBuffer[i] self.ringBuffer[i] = nil end self.bufferLength = maxBufferSize self.insertPoint = maxBufferSize > 0 and self.insertPoint % maxBufferSize or 0 end
-- add new value into buffer and update totals local oldValue = self.ringBuffer[self.insertPoint] or 0 self.ringBuffer[self.insertPoint] = newValue self.runningTotal = self.runningTotal + newValue - oldValue self.insertPoint = self.insertPoint + 1 self.bufferLength = math.max(self.bufferLength, self.insertPoint) if self.insertPoint >= maxBufferSize then self.insertPoint = 0 end return self.bufferLength > 0 and self.runningTotal / self.bufferLength or 0 end, }
previousFuelValue = nil fuelFlowRate = MovingAverage:new()
function onTick()
local newFuelValue = input.getNumber(1) local maxBufferSize = math.ceil(input.getNumber(2)*60) if previousFuelValue then local deltaPerMinute = (previousFuelValue - newFuelValue)*60 -- per second to per minute local flowRate = fuelFlowRate:update(deltaPerMinute, maxBufferSize) output.setNumber(1, flowRate*60) -- flowRate is average per tick: per second is 60 times as much end previousFuelValue = newFuelValue end

contacts={} nextContactID=0 isRadarOn=false zoom=1 radarAngle=0 gps = nil ticks = 0 expiryTicks = 150 fadeFactor = 0.75 waypoints = {}
function onTick() isRadarOn = input.getBool(9) zoom = input.getNumber(25) radarAngle = input.getNumber(26) gps = {input.getNumber(27), input.getNumber(28)} for i = 0,7 do local active = input.getBool(i+1) if active then local x = input.getNumber(i*3+1) local y = input.getNumber(i*3+2) local z = input.getNumber(i*3+3) contacts[nextContactID] = {posn={x,y,z}, time=ticks} nextContactID = nextContactID + 1 end end for id,contact in pairs(contacts) do if ticks - contact.time > expiryTicks then contacts[id] = nil end end ticks = ticks + 1 end
function onDraw() w = screen.getWidth() h = screen.getHeight() if isRadarOn then screen.setColor(255, 0, 0) for _,con in pairs(contacts) do local px,py = map.mapToScreen(gps[1], gps[2], zoom, w, h, con.posn[1], con.posn[2]) local alpha = math.min(1 - ((con.time/expiryTicks) - fadeFactor)/(1 - fadeFactor), 1) screen.setColor(255, 0, 255, alpha*255) screen.drawRectF(px,py,1,1) end end end
